INSERT INTO `buscar_profissionais` (`usu_id`,`nome`,`sobrenome`,`senha`,`email`,`email_validado`,`permissao`,`tipo_usuario`,`plano_tipo`,`data_in`,`data_primeiro_acesso`,`data_ultimo_acesso`,`cpf`,`avatar`,`sexo`,`info_inicial`,`pais`,`estado`,`municipio`,`cep`,`rua`,`numero`,`complemento`,`telefone_celular_principal`,`telefone_celular_secundario`,`telefone_residencial`,`telefone_comercial`,`code_trocar_senha`,`deletado`,`idEmpresa`,`udp_id`,`udp_usu_id`,`email_profissional`,`avaliacao_usuarios`,`sobre_profissional`,`resumo_formacao`,`yt_code_apresentacao`,`diferencial_profissional`,`atendimento_presencial`,`atendimento_online`,`mini_curriculo`,`resumo_formacao_academica`,`resumo_formacao_cursos`,`curriculo_lattes`,`nome_empresa`,`cnpj`,`ramo_empresa`,`tipo_empresa`,`cep_profissional`,`endereco_profissional_rua`,`endereco_profissional_numero`,`endereco_profissional_complemento`,`endereco_profissional_latitude`,`endereco_profissional_longitude`,`pais_empresa`,`estado_empresa`,`municipio_empresa`,`udp_deletado`,`Foto_Fechada`,`Logotipo`,`Mapa`,`endereco_profissional_bairro`,`Horarios_de_Atendimento`,`Sobre_a_Empresa`,`Lat`,`Lng`) VALUES (2,'Geraldo','','12345','geraldolimabr@gmail.com',NULL,10,NULL,10,NULL,NULL,'2020-11-03 08:48:42','','[{"name":"files\\/homem2_0ca0tp0f.jpeg","usrName":"homem2.jpeg","size":7286,"type":"image\\/jpeg","thumbnail":"files\\/thhomem2_0fi6cvbd.jpeg","thumbnail_type":"image\\/jpeg","thumbnail_size":4218,"searchStr":"homem2.jpeg,!:sStrEnd"}]','M','','','','',NULL,'','','','','','','',NULL,0,NULL,4,2,'sem@sem.com.br',0,'A terapia holística visa encontrar o equilíbrio entre o psíquico, o social e o corpóreo, ensinando o indivíduo a conhecer-se e trabalhar todos esses pontos em busca do seu bem-estar.','Sintomas como dores nos ombros e nas costas, estresse físico e emocional, angústia, ansiedade, TPM, entre outros, são causados quando esses campos estão em desarmonia em nosso organismo. Através de uma avaliação o terapeuta busca em nós o que está causando esses sintomas e elabora um tratamento para eliminá-lo.',NULL,'Uma febre, por exemplo, é sinal de alguma inflamação no corpo.Na medicina convencional as causas são ignoradas, buscando apenas o desaparecimento da inflamação, o que de acordo com a terapia holística não elimina a causa, podendo haver outras manifestações.','S','N','A terapia holística funciona fazendo a ligação entre o corpo físico e o energético, buscando a harmonia entre eles. O terapeuta faz o tratamento, porém o mais importante é ensinar a pessoa a buscar essa harmonia sozinha, sem depender sempre da terapia, aprendendo a lidar com o corpo e as emoções.','USP','Formado pela Escola Holista da USP',NULL,'Eu sou Holistico',2147483647,NULL,NULL,12916,'Rua das Sibipirinas','234','',NULL,NULL,'Brasil','SP','Bragança Paulista',0,'[{"name":"files\\/fachada2_c8ec44aa.jpeg","usrName":"fachada2.jpeg","size":10095,"type":"image\\/jpeg","searchStr":"fachada2.jpeg,!:sStrEnd"}]','[{"name":"files\\/logo3_ldsgwq2t.jpeg","usrName":"logo3.jpeg","size":15045,"type":"image\\/jpeg","searchStr":"logo3.jpeg,!:sStrEnd"}]',NULL,'Santa Helena','De Segunda a Sabado\r\ndas 09hs as 13hs','O Eu Sem Fronteiras conta com uma equipe de jornalistas e profissionais de comunicação empenhados em trazer sempre informações atualizadas. Aqui você não encontrará textos copiados de outros sites. Nossa proposta é a de propagar o bem sempre, respeitando os direitos alheios.',-22.9527000000,-46.5419000000);
INSERT INTO `buscar_profissionais` (`usu_id`,`nome`,`sobrenome`,`senha`,`email`,`email_validado`,`permissao`,`tipo_usuario`,`plano_tipo`,`data_in`,`data_primeiro_acesso`,`data_ultimo_acesso`,`cpf`,`avatar`,`sexo`,`info_inicial`,`pais`,`estado`,`municipio`,`cep`,`rua`,`numero`,`complemento`,`telefone_celular_principal`,`telefone_celular_secundario`,`telefone_residencial`,`telefone_comercial`,`code_trocar_senha`,`deletado`,`idEmpresa`,`udp_id`,`udp_usu_id`,`email_profissional`,`avaliacao_usuarios`,`sobre_profissional`,`resumo_formacao`,`yt_code_apresentacao`,`diferencial_profissional`,`atendimento_presencial`,`atendimento_online`,`mini_curriculo`,`resumo_formacao_academica`,`resumo_formacao_cursos`,`curriculo_lattes`,`nome_empresa`,`cnpj`,`ramo_empresa`,`tipo_empresa`,`cep_profissional`,`endereco_profissional_rua`,`endereco_profissional_numero`,`endereco_profissional_complemento`,`endereco_profissional_latitude`,`endereco_profissional_longitude`,`pais_empresa`,`estado_empresa`,`municipio_empresa`,`udp_deletado`,`Foto_Fechada`,`Logotipo`,`Mapa`,`endereco_profissional_bairro`,`Horarios_de_Atendimento`,`Sobre_a_Empresa`,`Lat`,`Lng`) VALUES (1,'Geraldo','Lima','12345','geraldojuarez@terra.com.br',NULL,10,1,10,NULL,NULL,'2020-10-27 17:24:18','123.145.717-86','[{"name":"files\\/avatar (1)_dc0392v3.jpeg","usrName":"avatar (1).jpeg","size":29519,"type":"image\\/jpeg","thumbnail":"files\\/thavatar (1)_gdz5pktb.jpeg","thumbnail_type":"image\\/jpeg","thumbnail_size":4235,"searchStr":"avatar (1).jpeg,!:sStrEnd"}]','M','Sou prifissional de Saude','BRA','SP','3507605',12456666,'Sabipiruna','125','casa','121121212','12312131','321321212','21213212',NULL,0,NULL,5,1,'teste@teste.com.br',0,'A Holos nasceu para ser facilitadora, uma espécie de agente de saúde para empresas e funcionários. Segundo Gustavo Souza, não adiantava entregar um portfólio explicando terapias holísticas e integrativas para as empresas, era necessário ir além e apresentar uma solução pronta.','“Inovação é você facilitar o acesso a algo que, muitas vezes, é difícil chegar à grande parte da população. Na minha área, estou conseguindo inovar levando às pessoas técnicas de 4 mil anos que não são acessíveis porque tem misticismo por trás. Inovação é popularizar e conectar, não necessariamente precisa ter tecnologia, basta levar com poucos recursos coisas que fazem bem para a humanidade. Minha missão, por exemplo, é popularizar técnicas holísticas”, Gustavo Souza, fundador da Holos, startup que viabiliza terapias holísticas e integrativas em ambientes corporativos.',NULL,'A Holos é uma das quatro startups finalistas do PUC TEC, o Hub de Inovação da PUC Minas. Estamos apresentado, a cada semana, uma das finalistas e você poderá conferir as reportagens aqui no site. Ao todo, 189 startups se candidataram no edital proposto pela universidade e as quatro finalistas receberam, cada uma, o aporte de R$200 mil. Também foram oferecidas mentorias e  assessorias para as startups participantes.','S','S','A startup cresceu cinco vezes em 2019 e tem objetivo de atender a cerca de 6 mil pessoas dentro do ambiente corporativo. “Queremos atingir o maior número de vidas possíveis”.','','',NULL,'Centro de Tratamento Holistico',2147483647,NULL,NULL,27180000,'Rua da Candelaria','123','',NULL,NULL,'Brasil','RJ','Rio de Janeiro',0,'[{"name":"files\\/fachada3_uhydx4xw.jpeg","usrName":"fachada3.jpeg","size":7780,"type":"image\\/jpeg","searchStr":"fachada3.jpeg,!:sStrEnd"}]','[{"name":"files\\/logo1_7eooowv1.jpeg","usrName":"logo1.jpeg","size":5051,"type":"image\\/jpeg","searchStr":"logo1.jpeg,!:sStrEnd"}]',NULL,'Centro','De Segunda a Sexta-feira\r\ndas 08hs as 22hs','A Holos nasceu para ser facilitadora, uma espécie de agente de saúde para empresas e funcionários. Segundo Gustavo Souza, não adiantava entregar um portfólio explicando terapias holísticas e integrativas para as empresas, era necessário ir além e apresentar uma solução pronta.',-23.0035000000,-46.8464000000);
